export default (function(a,b,c,d,e,f,g,h){return {data:{cuHfBQZqw0:{data:{id:659,attributes:{imdbId:"tt0068403",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYTc1YWY0ZmYtNGM5Ni00MmEwLThjZWItMjFkMTczM2MwZDY4L2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"}],item_lang:{data:{id:1322,attributes:{title:"Come Back Charleston Blue",plot:"Sequel to Cotton comes to Harlem. Another bad influence is hitting Harlem and Gravedigger and Coffin Ed are the two cops who will stop it. Charleston Blue was a prohibition era black gangster, dead 4 decades. When he seems to have reappeared, once again slitting throats with his Blue straight edge razors, the two cops begin a complicated search for some answers.",slug:"come-back-charleston-blue"}}},books:{data:[{id:4453,attributes:{title:e,description:f,thumbnail:g,authors:[b],firstBook:true,published:h,publisher:c,subtitle:a}},{id:4454,attributes:{title:e,description:f,thumbnail:g,authors:[b],firstBook:d,published:h,publisher:c,subtitle:a}},{id:4455,attributes:{title:"The Heat's on",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=y1hcAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Chester B. Himes"],firstBook:d,published:"1966-01-01",publisher:a,subtitle:a}},{id:4456,attributes:{title:"Blind Man with a Pistol",description:"At once grotesquely comic and unflinchingly violent, Blind Man With a Pistol is the final entry in Chester Himes's trailblazing Harlem Detectives series. New York is sweltering in the summer heat, and Harlem is close to the boiling point. To Coffin Ed Johnson and Grave Digger Jones, at times it seems as if the whole world has gone mad. Trying, as always, to keep some kind of peace—their legendary nickel-plated Colts very much in evidence—Coffin Ed and Grave Digger find themselves pursuing two completely different cases through a maze of knifings, beatings, and riots that threaten to tear Harlem apart.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HbvztcgUjGgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2011-07-27",publisher:c,subtitle:a}},{id:4457,attributes:{title:"A Rage in Harlem",description:"A Rage in Harlem is a ripping introduction to Coffin Ed Johnson and Grave Digger Jones, patrolling New York City’s roughest streets in Chester Himes’s groundbreaking Harlem Detectives series. For love of fine, wily Imabelle, hapless Jackson surrenders his life savings to a con man who knows the secret of turning ten-dollar bills into hundreds—and then he steals from his boss, only to lose the stolen money at a craps table. Luckily for him, he can turn to his savvy twin brother, Goldy, who earns a living—disguised as a Sister of Mercy—by selling tickets to Heaven in Harlem. With Goldy on his side, Jackson is ready for payback.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=M496KtUd5T0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2011-07-20",publisher:c,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940947555}}("","Chester Himes","Vintage Crime\u002FBlack Lizard",null,"The Heat's On","Detectives Coffin Ed and Grave Digger Jones are in the hot seat in one of the most chaotic, brutally funny novels in Chester Himes’s groundbreaking Harlem Detectives series. From the start, nothing goes right for Coffin Ed and Grave Digger. They are disciplined for use of excessive force. Grave Digger is shot and his death announced in a hoax radio bulletin. Bodies pile up faster than Coffin Ed and Grave Digger can run. Yet, try as they might, they always seem to be one hot step behind the cause of all the mayhem—three million dollars’ worth of heroin and a giant albino called Pinky.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=gbrRMOnmVy0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-08-31"))